import React, { Component } from 'react';
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import CardGroup from 'react-bootstrap/CardGroup';
import CardColumns from 'react-bootstrap/CardColumns';


export default class Portfolio extends Component {
  render() {
    return (
      <div>
        <section className="portfolio-section" data-section="portfolio">
                      <h2 className="main-h2">Projects</h2>
            <div className="row card-wrapper">
              <div className="col-md-12">
                <Card style={{ width: '18rem' }}>
                  <Card.Img variant="top" width="100%" src="https://images.pexels.com/photos/7674901/pexels-photo-7674901.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=750&w=1260" />
                    <Card.ImgOverlay>
                    /* <Card.Body> */
                    <Card.Title>Card Title</Card.Title>
                    <Card.Text>
                      <p>Some quick example text to build on the card title and make up the bulk of
                      the card's content.</p>
                      </Card.Text>
                  <Button variant="primary">Go somewhere</Button>
                  /* </Card.Body> */
                </Card.ImgOverlay>
                </Card>
              </div>
            </div>
        </section>
      </div>
    )
  }
}
